import { AppBar, Drawer, Toolbar } from '@mui/material'
import React from 'react'

const CustomRightDrawer = () => {
  return (
    <div>
      <AppBar>
        <Toolbar>Hello Right!</Toolbar>
      </AppBar>
      <Drawer variant='permanent'> Hello Right Drawer</Drawer>
    </div>
  )
}

export default CustomRightDrawer
